description:
Все автомобили, представленные в продаже, проходят тщательную проверку по 47 параметрам. Предоставляем гарантию юридической чистоты, а так же год технической гарантии на двигатель и КПП в письменной форме. Бесплатный тест-драйв. Возможно оформление автомобиля в кредит!

Преимущества автокредитования:
— Ставка по кредиту от 8% годовых;
— Первоначальный взнос от 0%;
— Более 20 кредитных программ;
— Минимальный пакет документов – паспорт и вод. удостоверение;
— Срок кредита от 6 месяцев до 7 лет;
— Сумма кредита от 60 000 руб. до 3 000 000 рублей;
— Досрочное погашение без штрафов и комиссий;
— КАСКО – необязательно.

Дополнительная скидка до 50 000 рублей при покупке автомобиля по программе Trade-In (обмен на ваш автомобиль) или в кредит!

Записаться на тест-драйв, а так же получить подробную информацию можно у специалистов автоцентра по указанному номеру телефона. Указанная цена автомобиля в объявлении соответствует заявленной стоимости в автосалоне.
